import React from 'react'
import classes from './Todos.module.css'

import TodoItem from './TodoItem'

type TodosProps = {
  id: number
  text: string
}

const Todos: React.FC<{ items: TodosProps[]; removeTodo: Function }> = ({
  items,
  removeTodo,
}) => {
  return (
    <ul className={classes.todos}>
      {items.map(item => {
        return <TodoItem onClick={removeTodo} key={item.id} text={item.text} />
      })}
    </ul>
  )
}

export default Todos
